الكذب المغربي يتواصل deepfake
وسائل إعلام مغربية وصفحات نخب العار المغربية تنشر صورة لإيلون ماسك معدلة بالذكاء الاصطناعي على أساس أن  رجل الأعمال مالك #تويتر و #تيسلا يقضي إجازته في شفشاون المغربية 
#fact_check 
@misbarfc 
@elonmusk https://t.co/gN1IWt0Ije

@MSAlmalik الحكومه اللبنانيه تستطيع الطلب من تركيا التدخل لمساعدتها بسحق خؤلاء الجرذان . فقط  

الجيش التركي يضرب موقع عسكري مشترك بين قوات النظام السوري والوحدات الكردية بالقرب من مدينة منبج وينشر مقاطع للعملية .

